contracts/CreateQuest.sol.content:
// SPDX-License-Identifier: MIT

pragma solidity ^0.8.7;

contract Quests {

    uint private _questIdCounter;

    struct QuestInfo {
        uint id;
        string title;
        string description;
        string steps;
        string reward;
        bool completed;
    }

    event QuestSubmission (
        uint id,
        string title,
        string description,
        string steps,
        string reward,
        bool completed
    );

    event QuestCompletion (
        uint id,
        bool completed
    );

    QuestInfo[] public questList;

    // Function to create a new quest
    function createQuest(
        string memory _title,
        string memory _description,
        string memory _steps,
        string memory _reward
    ) public {
        require(bytes(_title).length > 0, "Title cannot be empty");
        require(bytes(_description).length > 0, "Description cannot be empty");
        require(bytes(_steps).length > 0, "Steps cannot be empty");
        require(bytes(_reward).length > 0, "Reward cannot be empty");

        uint _questId = _questIdCounter;

        questList.push(QuestInfo(_questId, _title, _description, _steps, _reward, false));

        _questIdCounter++;

        emit QuestSubmission(
            _questId,
            _title,
            _description,
            _steps,
            _reward,
            false
        );
    }

    // Mark a quest as completed
    function completeQuest(uint _questId) public {
        require(_questId < questList.length, "Invalid quest ID");
        QuestInfo storage quest = questList[_questId];
        require(!quest.completed, "Quest already completed");

        quest.completed = true;

        emit QuestCompletion(_questId, true);
    }

    // Return the entire list of quests
    function getQuestList() public view returns (QuestInfo[] memory) {
        return questList;
    }
}

contracts/Curios.sol.content:
// SPDX-License-Identifier: MIT

pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/cryptography/MerkleProof.sol";

contract Tavern is Ownable {
    // Quest model
    struct Quest {
        address creator;
        uint index;
        string name;
        string hint;
        bytes32 merkleRoot;
        string merkleBody;
        uint maxWinners;
        string metadata;
        bool valid;
        mapping (address => bool) winners;
        address[] winnersIndex;
        mapping (address => bool) claimers; // Removed claimers as we are not using rewards
    }

    // State
    mapping (address => Quest[]) public quests;
    mapping (address => mapping (address => uint[])) public questsPerCreator;

    // Events
    event QuestCreated(address _tokenAddress, uint _questIndex);
    event QuestValidated(address _tokenAddress, uint _questIndex);
    event QuestCompleted(address _tokenAddress, uint _questIndex, address _winner);

    // Constructor
    constructor(address initialOwner) Ownable(initialOwner) {}

    // Creates a new quest
    function createQuest(address _tokenAddress, string memory _name, string memory _hint, uint _maxWinners, bytes32 _merkleRoot, string memory _merkleBody, string memory _metadata) public {
        Quest storage newQuest = quests[_tokenAddress].push();
        uint questIndex = quests[_tokenAddress].length - 1;

        {
            // Scope for initializing quest
            newQuest.creator = msg.sender;
            newQuest.index = questIndex;
            newQuest.name = _name;
            newQuest.hint = _hint;
            newQuest.merkleRoot = _merkleRoot;
            newQuest.merkleBody = _merkleBody;
            newQuest.maxWinners = _maxWinners;
            newQuest.metadata = _metadata;
        }

        questsPerCreator[_tokenAddress][msg.sender].push(questIndex);

        emit QuestCreated(_tokenAddress, questIndex);

        validateQuest(_tokenAddress, questIndex);
    }

    function validateQuest(address _tokenAddress, uint _questIndex) public {
        Quest storage quest = quests[_tokenAddress][_questIndex];
        require(!quest.valid, "Quest is already valid");

        quest.valid = true;
        emit QuestValidated(_tokenAddress, _questIndex);
    }

    function submitProof(address _tokenAddress, uint _questIndex, bytes32[] memory _proof, bytes32 _answer) public {
        Quest storage quest = quests[_tokenAddress][_questIndex];

        require(quest.valid, "Quest is not valid");
        require(quest.winnersIndex.length < quest.maxWinners || quest.maxWinners == 0, "Max winners reached");
        require(!quest.winners[msg.sender], "Already a winner");
        require(msg.sender != quest.creator, "Creator cannot win their own quest");
        require(MerkleProof.verify(_proof, quest.merkleRoot, _answer), "Invalid Merkle proof");

        {
            // Scope for winner logic
            quest.winners[msg.sender] = true;
            quest.winnersIndex.push(msg.sender);

            emit QuestCompleted(_tokenAddress, _questIndex, msg.sender);
        }
    }

    function isWinner(address _tokenAddress, uint _questIndex, address _allegedWinner) public view returns (bool) {
        return quests[_tokenAddress][_questIndex].winners[_allegedWinner];
    }

    function getQuestAmount(address _tokenAddress) public view returns (uint) {
        return quests[_tokenAddress].length;
    }

    function getQuestAmountPerCreator(address _tokenAddress, address _creator) public view returns (uint) {
        return questsPerCreator[_tokenAddress][_creator].length;
    }

    function getQuestIndexPerCreator(address _tokenAddress, address _creator, uint _creatorIndex) public view returns (uint) {
        return questsPerCreator[_tokenAddress][_creator][_creatorIndex];
    }

    function getQuest(address _tokenAddress, uint _questIndex) public view returns (
        address creator,
        uint index,
        string memory name,
        string memory hint,
        bytes32 merkleRoot,
        string memory merkleBody,
        uint maxWinners,
        string memory metadata,
        bool valid,
        address[] memory winnersIndex
    ) {
        Quest storage quest = quests[_tokenAddress][_questIndex];
        return (
            quest.creator,
            quest.index,
            quest.name,
            quest.hint,
            quest.merkleRoot,
            quest.merkleBody,
            quest.maxWinners,
            quest.metadata,
            quest.valid,
            quest.winnersIndex
        );
    }

    function getQuestWinners(address _tokenAddress, uint _questIndex) public view returns (address[] memory) {
        return quests[_tokenAddress][_questIndex].winnersIndex;
    }
}

contracts/Lock.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.20;

// Uncomment this line to use console.log
// import "hardhat/console.sol";

contract Lock {
    uint public unlockTime;
    address payable public owner;

    event Withdrawal(uint amount, uint when);

    constructor(uint _unlockTime) payable {
        require(
            block.timestamp < _unlockTime,
            "Unlock time should be in the future"
        );

        unlockTime = _unlockTime;
        owner = payable(msg.sender);
    }

    function withdraw() public {
        // Uncomment this line, and the import of "hardhat/console.sol", to print a log in your terminal
        // console.log("Unlock time is %o and block timestamp is %o", unlockTime, block.timestamp);

        require(block.timestamp >= unlockTime, "You can't withdraw yet");
        require(msg.sender == owner, "You aren't the owner");

        emit Withdrawal(address(this).balance, block.timestamp);

        owner.transfer(address(this).balance);
    }
}

